import React from "react";

const Footer = () => {
  return (
    <div id="footer-bottom">
      <div className="container">
        <div className="row">
          <div className="col-lg-12 col-md-12 col-sm-12">
            <p>2021 Phạm Trung Tuyên</p>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Footer;
